import React, { Component } from 'react'
import Lottie from 'react-lottie-player'

import lottieJson from './my-lottie.json'

class Example extends Component {
  render() {
    return (
      <Lottie
        loop
        animationData={lottieJson}
        play
        style={{ width: 150, height: 150 }}
      />
    )
  }
}
